#Kawah Manulalu
#Gunung Manulalu 
Gunung Manulalu merupakan Salah Satu gunung berapi di Flores. Menurut penduduk sekitar kata "Manulalu" berarti "Ayam Jantan" Karena di puncak Manulalu terdapat 3 Batu yang membentuk kepala ayam Jantan. Gunung Manulalu terletak disebelah Utara Gunung Inerie dengan ketinggian 1500 MDPL. Gunung Manulalu memiliki beberapa puncak dengan 6 kawah di atasnya. Beberapa kawah disebut Penduduk sekitar yaitu kawah Manulalu, kawah Liaviri, kawah Putih, dan kawah Bobo. Kawah Manulalu merupakan spot foto terbaik gunung Inerie dari ketinggian 1500MDPL. Jika ingin menaiki gunung Manulalu, pendakian terdekat di desa watumeze. Dengan sudut elevasi pendakian sekitar 20-60 derajat. Pendakian membutuhkan waktu 1 - 2 jam. Sebaiknya pendakian dilakukan pada musim panas karena tanah humus pada trekking dapat menjadi Lumpur jika terkena hujan. 
