Puncak Inerie
Gunung Inerie merupakan titik tertinggi pulau Flores yaitu dengan ketinggian 2245 mdpl. Gunung Inerie juga merupakan gunung berapi tertinggi di provinsi Nusa Tenggara Timur.
Meskipun memiliki ketinggian yang terbilang Pendek jika dibandingkan dengan gunung-gunung di pulau Jawa Dan Sumatera, Jalur pendakian gunung Inerie terbilang sulit dengan sudut elevasi 60-70 derajat dari kaki gunung Dan 70-85 derajat ketika mendekati puncak. Medan Batu vulcanic yang rapuh Dan mudah longsor. 
Gunung Inerie menyimpan keindahan yang sangat jarang ditemukan di gunung gunung lain. 
